import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { MapPin, Star } from 'lucide-react';

import './ArtistShowcase.css';

interface Artist {
  id: number;
  name: string;
  origin: string;
  flag: string;
  style: string;
  image: string;
  description: string;
  featured: boolean;
}

const artists: Artist[] = [
  {
    id: 1,
    name: "Cornel & Rithika",
    origin: "India",
    flag: "ðŸ‡®ðŸ‡³",
    style: "CONRI STYLE BACHATA",
    image: "../assets/img1.avif",
    description: "Revolutionary bachata style creators from India, bringing fresh perspectives to the dance world.",
    featured: true,
  },
  {
    id: 2,
    name: "Ronald & Alba",
    origin: "Spain",
    flag: "ðŸ‡ªðŸ‡¸",
    style: "BACHATA",
    image: "/api/placeholder/300/400",
    description: "Spanish bachata masters known for their passionate and authentic dance style.",
    featured: true,
  },
  {
    id: 3,
    name: "Korke & Judith",
    origin: "Spain",
    flag: "ðŸ‡ªðŸ‡¸",
    style: "CREATORS OF BACHATA SENSUAL",
    image: "/api/placeholder/300/400",
    description: "The legendary creators of Bachata Sensual, revolutionizing the dance with their innovative style.",
    featured: true,
  },
  {
    id: 4,
    name: "Leandro & Jomante",
    origin: "Spain | Lithuania",
    flag: "ðŸ‡ªðŸ‡¸ðŸ‡±ðŸ‡¹",
    style: "BACHATA",
    image: "/api/placeholder/300/400",
    description: "International bachata duo bringing together Spanish passion and Lithuanian precision.",
    featured: true,
  },
];

const ArtistShowcase: React.FC = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
      },
    },
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.6,
        ease: "easeOut",
      },
    },
  };

  return (
    <section className="artist-showcase">
      <div className="container">
        <motion.div
          className="showcase-header"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">CHECK OUT OUR TOP ARTISTS</h2>
        </motion.div>

        <motion.div
          className="artists-grid"
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
        >
          {artists.map((artist) => (
            <motion.div
              key={artist.id}
              className="artist-card"
              variants={itemVariants}
              whileHover={{ y: -10 }}
              transition={{ duration: 0.3 }}
            >
              <div className="artist-image-container">
                <div className="artist-image">
                  <img 
                    src={artist.image} 
                    alt={artist.name}
                    onError={(e) => {
                      const target = e.target as HTMLImageElement;
                      target.src = `https://via.placeholder.com/300x400/6B46C1/FFFFFF?text=${encodeURIComponent(artist.name)}`;
                    }}
                  />
                </div>
                <div className="artist-overlay">
                  <div className="artist-info-overlay">
                    <h3 className="artist-name">{artist.name}</h3>
                    <div className="artist-origin">
                      <MapPin size={16} />
                      <span>{artist.origin} {artist.flag}</span>
                    </div>
                    <p className="artist-style">{artist.style}</p>
                  </div>
                </div>
                {artist.featured && (
                  <div className="featured-badge">
                    <Star size={16} />
                    <span>Featured</span>
                  </div>
                )}
              </div>
              
              <div className="artist-details">
                <h3 className="artist-name">{artist.name}</h3>
                <div className="artist-origin">
                  <MapPin size={16} />
                  <span>{artist.origin} {artist.flag}</span>
                </div>
                <p className="artist-style">{artist.style}</p>
                <p className="artist-description">{artist.description}</p>
              </div>
            </motion.div>
          ))}
        </motion.div>

        <motion.div
          className="showcase-cta"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <Link to="/artists" className="btn btn-primary">
            View All Artists
          </Link>
        </motion.div>
      </div>
    </section>
  );
};

export default ArtistShowcase;
